import React from 'react'
import {Link,BrowserRouter as Router,Switch} from 'react-router-dom'
import NewPost from './NewPost'

function Nav() {
  const change=((e)=>{
      if(e.target.value==="Home"){
        window.location.href="/post"
      }
      else if(e.target.value==="Post"){
        window.location.href="/newpos"
      }
      
    
  })
  return (
    <div className='nav navbar bg-black d-flex p-2 focus-ring-warning'>
        <input placeholder='Search Posts' className='col-7'></input>
        <div className='d-flex  col-5 justify-content-between  '>
          <button className='btn text-white' onClick={change}>Home</button>
          <button className='btn text-white'>Post</button>
          <button className='btn text-white'>About</button>
        </div>
    </div>
  )
}

export default Nav
